The area of a right-angled triangle can be calculated using the formula: Area = (base * height) / 2. In this case, the base and height can be determined from the coordinates of the points P, Q, and R.

Here is a simple Octave code snippet that calculates the area:

```octave
% Define the points
P = [0, 5];
Q = [6, 9];
R = [12, 0];

% Calculate the base and height
base = norm(Q - R);
height = norm(P - Q);

% Calculate the area
area = (base * height) / 2;
disp(area);
```

This code first calculates the distance between the points Q and R to get the base of the triangle. Then, it calculates the distance between the points P and Q to get the height. Finally, it calculates the area using the formula and displays the result.

