Yes, it is possible to solve this problem programmatically using GNU Octave. The problem can be solved using permutations, which is a function in Octave. Here is a simple script to solve the problem:

```octave
function count_permutations(word)
    % Get the unique letters and their counts
    unique_letters = unique(word);
    letter_counts = hist(word, unique_letters);

    % Calculate the total number of permutations
    total_permutations = factorial(length(word));

    % Calculate the number of permutations for each unique letter
    permutations_for_each_letter = factorial(letter_counts);

    % Calculate the number of unique permutations
    unique_permutations = total_permutations / prod(permutations_for_each_letter);

    % Display the result
    disp(unique_permutations);
endfunction

% Test the function
word = 'NINE';
count_permutations(word);
```

This script first calculates the total number of permutations of the letters in the word. Then it calculates the number of permutations for each unique letter. Finally, it divides the total number of permutations by the product of the permutations for each unique letter to get the number of unique permutations.

