% Define the points
A = [10, -10];
O = [0, 0];

% Define the line equation
line_equation = @(x) -x + 6;

% Find the midpoint between A and O
midpoint = (A + O) / 2;

% Find the slope of the line connecting A and O
slope = (A(2) - O(2)) / (A(1) - O(1));

% Find the equation of the perpendicular bisector of AO
perpendicular_bisector = @(x) -1/slope * (x - midpoint(1)) + midpoint(2);

% Find the intersection of the perpendicular bisector and the line y = -x + 6
[x, y] = polyxpoly(perpendicular_bisector, line_equation, [0, 1]);

% The intersection point is the point P
P = [x, y];

% Display the result
disp(P)
```

