% Calculate the angle between the two hands
angle_between_hands = abs(hour_hand_angle - minute_hand_angle);

% Check if the angle is obtuse
if angle_between_hands > 180
  % If the angle is not obtuse, calculate the smaller obtuse angle
  smaller_obtuse_angle = 360 - angle_between_hands;
else
  % If the angle is obtuse, the angle between the hands is the smaller obtuse angle
  smaller_obtuse_angle = angle_between_hands;
end

% Print the answer
disp(smaller_obtuse_angle)

