The given equation is $x^2+y^2 - 6 = 6x + 2 y$. To rewrite it in the standard form, you need to complete the square for both $x$ and $y$.

For $x$, you have $x^2 - 6x$. Half of $-6$ is $-3$, and squaring it gives $9$. So, you add and subtract $9$ to get $(x-3)^2 - 9$.

For $y$, you have $y^2 + 2y$. Half of $2$ is $1$, and squaring it gives $1$. So, you add and subtract $1$ to get $(y+1)^2 - 1$.

So, the equation becomes $(x-3)^2 - 9 + (y+1)^2 - 1 = 0$, which simplifies to $(x-3)^2 + (y+1)^2 = 10$.

So, the radius of the cookie is $\sqrt{10}$.

