function count_colorings(triangles, colors)
  if triangles == 0
    % Base case: 1 way to color 0 triangles
    disp(1);
    return;
  endif

  % Recursive case: For each color, count the number of ways to color the remaining triangles
  count = 0;
  for i = 1:colors
    count += count_colorings(triangles - 1, colors);
  endfor

  % Subtract the invalid cases where two adjacent triangles have the same color
  count -= count_colorings(triangles - 2, colors);

  disp(count);
endfunction

