The problem can be solved programmatically using GNU Octave. The task is to find the number of ordered triplets $(a,b,c)$ of rational numbers that are the roots of the cubic equation $x^3 + ax^2 + bx + c = 0$.

To solve this problem, we can use the fact that the coefficients of a polynomial are symmetric functions of its roots. In particular, the sum of the roots is equal to the negative of the coefficient of $x^2$, the product of the roots is equal to the constant term, and the sum of the pairwise products of the roots is equal to the coefficient of $x$.

We can use these facts to set up a system of equations and solve for the number of ordered triplets $(a,b,c)$. We can use the `roots` function in GNU Octave to find the roots of the cubic equation, and then use the `sym` function to symbolically represent the coefficients of the polynomial in terms of the roots. We can then use the `solve` function to solve for the number of ordered triplets $(a,b,c)$.

Here is some sample code in GNU Octave that solves the problem:
```
% Define the coefficients of the cubic equation
a = sym('a');
b = sym('b');
c = sym('c');

% Define the polynomial
p = [1 a b c];

% Find the roots of the polynomial
r = roots(p);

% Define the symmetric functions of the roots
s1 = sum(r);
s2 = prod(r);
s3 = sum(r .* r');

% Set up the system of equations
eq1 = s1 == -a;
eq2 = s2 == c;
eq3 = s3 == b;

% Solve the system of equations
sol = solve([eq1 eq2 eq3], [a b c]);

% Count the number of solutions
num_solutions = length(sol.a);

% Display the result
disp(num_solutions);
```
This code will output the number of ordered triplets $(a,b,c)$ that are the roots of the cubic equation.

