function intersections = calculate_circle_intersections(circle1, circle2)
  % Define the equations of the circles
  x1 = circle1(1); y1 = circle1(2); r1 = circle1(3);
  x2 = circle2(1); y2 = circle2(2); r2 = circle2(3);

